import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import MakeTask from './components/make_task';
import CatalogPage from './components/CatalogPage';
import TextDetailPage from './components/TextDetailPage';
import TransitionWrapper from './components/TransitionWrapper'; // Import the TransitionWrapper component

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<TransitionWrapper><CatalogPage /></TransitionWrapper>} />
          <Route path="/make-task" element={<TransitionWrapper><MakeTask /></TransitionWrapper>} />
          <Route path="/text-detail/:index" element={<TransitionWrapper><TextDetailPage /></TransitionWrapper>} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
